import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	top_container: {
		display: "grid",
		gridTemplateColumns: "auto auto",
		marginLeft: 30,
		marginRight: 30,
	},
	buttons: {
		display: "flex",
		justifyContent: "flex-end",
	},
	topIconButton1: {
		marginLeft: theme.spacing(2),
		marginRight: theme.spacing(2),
	},
	topIconButton2: {},
}));
